import React, { useEffect, useState } from 'react'
import Axios from 'axios';
import { useNavigate, useLocation } from 'react-router-dom';

function Event() {
  const navigate = useNavigate();
  const location = useLocation();
  const [eventData, setEventdata] = useState([]);
  const [userid,setUserid] = use
  useEffect(() => {
    setEventdata(location.state.event);

  }, [setEventdata]);
  const handleRegistered = () => {
    Axios.post('http://localhost:3001/addRegister', {
      event: eventData,
      userid: userid
    })
      .then((res) => {
        if (res.data === "Success") {
          alert("Redirecting to Orignal website...");
        } else {
          alert("Do not register...");
        }
      })
  }
  return (
    <div>
      <h2>Event Details</h2>
      <a href={`${eventData.reglink}`} onClick={handleRegistered}>Click here to Register</a>
    </div>
  )
}

export default Event
